import styled from 'styled-components/native';
import { colors } from '../../../infrastructure/theme/colors';
import { Button } from 'react-native-paper';

export const LogisticsContainer = styled.View`
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #000;
  flex: 1;
`;

export const LogisticsPrimary = styled.Text`
   margin-top: 60px;
   color: #fff;
   text-align: center;
   font-size: 15px;
   font-weight: bold;
`;

export const LogisticsWrapper = styled.View`
  display: grid;
  z-index: 1;
  margin-left: 30px;
  padding: 0 24px;
  margin-top: 40px;
  justify-content: center;
`;

export const LogisticsRow = styled.View`
  display: grid;
  grid-auto-columns: minmax(auto, 1fr);
  align-items: center;
  grid-template-areas: ${({imgStart}) => (imgStart ? `'col2 col1'` : `'col1 col2'`)};
`;

export const Column1 = styled.View`
  margin-bottom: 15px;
  padding: 0 18px;
  grid-area: col1;
`;

export const Column2 = styled.View`
   margin-bottom: 15px;
   padding: 0 25px;
   grid-area: col2;
`;

export const LogisticsSlot = styled.Text`
  color: #fff;
  font-size: 10px;
  text-align: left;
  margin-top: 20px;
  font-family: 'Roboto';
`;

export const LogisticsBox = styled.View`
   position: relative;
   width: 128px;
   height: 96px;
   top: 20px;
   background: #4E4E4E;
   border-radius: 5px;
`;

export const LogisticsBtnCont = styled.View`
   color: #000;
`;

export const LogisticsBtn = styled(Button).attrs(
  { color: colors.ui.primary, })`
   width: 300px;
   height: 48px;
   top: 30px;
   position: relative;
   left: 10px;
   padding: 12px;
   background: Constants.theme.primary;
   border-radius: 5px;
`;
